import React, { Component } from 'react';

class FavoriteButton extends Component {

    render() {
        const {
            width,
            height,
            fill,
            viewBox,
            xmlns,
            d,
            onClick
        } = this.props;

        return (
            <button
                className="Favorite__Btn"
                onClick={onClick}
            >
                <svg
                    width={width}
                    height={height}
                    fill="none"
                    viewBox={viewBox}
                    xmlns={xmlns}
                >
                    <path
                        d={d}
                        fill={fill}
                    />
                </svg>
            </button>
        )
    }
}

export default FavoriteButton;
